import React,{useState,useEffect} from 'react'
import { useParams } from 'react-router-dom'
import axios from 'axios'


function UserInfo() {

    const [users,setUser] = useState([])
    const {mobile} = useParams()

    useEffect(()=>{
        axios.get("http://localhost:8080/users/info?mobNumber="+mobile) //http://localhost:3005/users?mobNumber=
        .then((res) => {
            setUser(res.data)
            console.log(res.data)
        })
    },[])

    return (
        <div className="container py-4">
            {
                users.map((user)=>(
                    <div key={user.id}>
                        <h1 className="display-4">User Id:  {user.id}</h1>
                        <hr />
                        <ul className="list-group w-50">
                            <li className="list-group-item">name: {user.name}</li>
                            <li className="list-group-item">mobile number: {user.mobNumber}</li>
                            <li className="list-group-item">email: {user.emailId}</li>
                        </ul>
                    </div>
                ))
            }
        </div>
    )
}

export default UserInfo
